package uz.gita.contactworkteam.diimport dagger.Bindsimport dagger.Moduleimport dagger.hilt.InstallInimport dagger.hilt.components.SingletonComponentimport uz.gita.contactworkteam.navigator.AppNavigatorimport uz.gita.contactworkteam.navigator.AppNavigatorDispatcherimport uz.gita.contactworkteam.navigator.AppNavigatorHandlerimport javax.inject.Singleton@Module@InstallIn(SingletonComponent::class)interface NavigationModule {    @[Binds Singleton]    fun appNavigator(impl: AppNavigatorDispatcher): AppNavigator    @[Binds Singleton]    fun appNavigatorHandler(impl: AppNavigatorDispatcher): AppNavigatorHandler}